'use strict';

/**
 * Lexer class.
 */
export default class Lexer {
    /**
     * Creates a new Lexer object.
     * @param {array} tokenMatchers An array of the escaped string form of a regex matching a token, a function to return a token given the matched text, the type of the returned token, and the scopes the regex should match in.
     * @param {number} scope Starting scope of the lexer
     */
    constructor (tokenMatchers, scope=0) {
        this.tokenMatchers = tokenMatchers.map(function (object) {
            object[0] = new RegExp('^' + object[0].replace(/[\/\r\n\t]/g, match => ('\\' + {
                '/': '/',
                '\r': 'r',
                '\n': 'n',
                '\t': 't'
            }[match])));
            return object;
        });
        this.scope = scope;
        this.variables = {};
    }

    tokenize (code) {
        let tokens = [];
        while (code.length) {
            let success = false;
            for (let [regex, onSuccess, type, allowedScopes] of this.tokenMatchers) {
                if (!((allowedScopes || 1) & this.scope))
                    continue;
                let match = regex.exec(code);
                if (match) {
                    let matched = match[0];
                    let token = onSuccess(this, matched);
                    if (!matched.length)
                        continue;
                    code = code.slice(matched.length);
                    if (typeof token !== 'undefined')
                        tokens.push(type ? [token, type] : token);
                    success = true;
                    break;
                }
            }
            if (!success)
                throw 'LexError: No match found';
            success = false;
        }
        return tokens;
    }

    begin (scope) {
        this.scope = scope;
    }
}

'use strict';

const defaultParent = {
    get: function () { return false; },
    set: function () { return false; },
    has: function () { return false; }
};

/**
 * Scope class.
 */
export default class Scope {
    /**
     * Creates a Scope object.
     * @param {Scope} parent The parent scope.
     */
    constructor (parent=defaultParent) {
        this.parent = parent;
        this.variables = {};
    }

    /**
     * Gets a variable from the scope.
     * @param {string} variable The name of the variable.
     * @return {object} The value of the variable.
     */
    get (variable) {
        if (this.parent.has(variable))
            return this.parent.get(variable);

        return this.variables[variable];
    }

    /**
     * Sets a variable in the scope to a certain value.
     * @param {string} variable The name of the variable.
     */
    set (variable, value) {
        if (this.parent.has(variable))
            this.parent.set(variable, value);

        this.variables[variable] = value;
    }

    /**
     * Checks if the scope contains a variable.
     * @param {string} variable The name of the variable.
     * @return {boolean} Whether the scope contains the variable.
     */
    has (variable) {
        return (typeof this.variables[variable] !== 'undefined') || this.parent.has(variable);
    }
}
